import React from "react";
import { Container, Col, Row } from "react-bootstrap";
import ReactDOM from "react-dom";
import "./styles/projectsPageStyle.css";
import { Element } from "react-scroll";
import CardStack from "./CardStack";

function ProjectsPage() {
  return (
    <div className="ProjectsPage" id="project-page">
      <Container>
        <h1 className="SoftwareEng-header">Software Engineering</h1>
        <Row>
          <Col sm={4} className="col 1-swe">
            <CardStack
              text="JARPAmazon"
              description="This is a card. You can put anything you want inside of it."
            />
          </Col>
          <Col sm={4} className="col 2-swe">
            <h2 className="swe-heading">Conmigo</h2>
          </Col>
          <Col sm={4} className="col 3-swe">
            <h2 className="swe-heading">Others</h2>
          </Col>
        </Row>
        <h1 className="DataScience-header">Data Science</h1>
        <Row>
          <Col sm={6} className="col 1-ds">
            <h2 className="ds-heading">Superbowl Commercials</h2>
          </Col>
          <Col sm={6} className="col 2-ds">
            <h2 className="ds-heading">IMDb Shiny App</h2>
          </Col>
        </Row>
      </Container>
    </div>
  );
}

export default ProjectsPage;
